              @"新疆故事广播":@"新疆评书小说娱乐第一品牌，乌鲁木齐首家主打女主播电台，6+2水果密语女主播，带来速度与激情，传递乌鲁木齐上空最文艺的声音！经典文化分享，演绎都市清新活力范儿！",
