              @"乌鲁木齐旅游音乐":@"106.5旅游音乐广播，天生爱精彩！106.5旅游音乐广播是西北五省第一家类型化音乐广播，这里有最专业的音乐、最严选的音乐、最顺耳的音乐、最对味的音乐——一切您喜欢的音乐，让您最大程度感受音乐的魅力。",
