              @"乌鲁木齐维语广播":@"这里是乌鲁木齐维语广播。",
              @"云南新闻广播":@"云南人民广播电台新闻广播（AM576、FM105.8）是以“新闻＋谈话”为定位的云南省第一家新闻类型化广播媒体，主要有新闻类、谈话类、服务类和文艺类节目，频率覆盖全省各地和周边国家。",
