              @"云南交通之声":@"这里是云南交通之声。交通之声于1999年4月1日开播，播出频率为FM91.8，以车辆驾乘人员、旅游观光人员为主要服务对象。经过近十年时间，已经发展成为云南市场触达率、收听率、占有率第一的广播频率。",
