              @"FM1008新闻资讯广播":@"FM1008新闻资讯广播 ——放眼天下事，倾听万家声。昆明广播电视台主频率，新闻资讯广播。",
              @"昆明NEW FM102.8":@"类型化的NewFM102.8是一个锐意进取、追求时尚品质的广播频率，是昆明地区最具影响力的声媒之一。全新改版的NEWFM102.8采用欧美新锐电台模式，是云南地区首家真正意义上的完全类型化电台频率。",
