              @"FM105城市资讯":@"FM105 城市资讯   以独特的节目体系为城市主流人群定制实时新闻、热点资讯、分类音乐，配合高人气脱口秀节目，共同打造独具收听优势的品牌节目群。路有界，心无涯——FM105 城市资讯",
              @"普洱人民广播电台综合广播":@"",
              @"大理电台苍洱调频":@"这里是来自大理的声音——大理人民广播电台。",
              @"安徽音乐广播":@"安徽人民广播电台音乐广播是安徽境内第一家专业音乐电台，于1999年3月12日开播，是安徽地区听众规模最大、最受欢迎的电台。",
              @"安徽城市之声":@"1055安徽城市之声全省双频覆盖，以“好生活，听我的”为品牌标识，以“好听实用、轻松伴随”为频率宗旨，节目内容将以海量的生活资讯为支撑，以精致的音乐节目为包装，用碎片化的播出形态兼顾移动客户端用户的收听习惯，办轻松有趣，好听实用的生活广播。我们的最终目标则是：打造一个与新媒体高度融合、有跨界影响力的互联网时代的广播产业链。",
              @"安徽交通广播":@"ONE FM90.8，安徽广播第一品牌 安徽交通广播 安徽省应急广播 互动微信：anhui908  新媒体广告投放专线：0551-63458708",
              @"安徽农村广播":@"安徽农村广播目前是我省唯一的面向“农业、农村、农民“的专业电台，是专门为安徽4800多万农业人口开办的电台。",
              @"安徽故事广播":@"种下一片故事的果园，我们一起采摘与收获......关注微信公众号“安徽故事频率”,新鲜福利天天有!",
              @"安徽戏曲广播":@"安徽戏曲广播以“打好徽字牌,唱响黄梅戏,建设文化强省”的文化发展战略为宗旨，形成“徽黄庐泗花鼓梆”齐头并进的安徽戏曲特色文化，力求用当代精神挖掘传统经典。",
              @"合肥交通广播":@"合肥市政府应急广播，安徽省第一家专业汽车频率，驾车、乘车、出行人的第一选择。",
              @"合肥故事广播":@"故事广播通过调频98.8，中波1170双频发射。听故事，听世界！",
              @"安庆综合广播":@"同心，同行，同精彩——FM90.3安庆综合广播",
              @"安庆交通音乐广播":@"安庆交通音乐广播成立于2002年12 月28日。播出频率为FM93.7。作为安庆市的主流媒体，秉承“服务交通，娱悦大众”的宗旨，坚持正确的舆论导向，做好党和政府的“喉舌”，服务安庆百姓生活，服务安庆商家企业，与安庆的城市发展共同成长。是安庆市人民政府应急广播。播出覆盖安庆六县一市三区及周边200公里范围，覆盖人口1000余万，为数字化的清晰城市调频广播。",
              @"黄山新闻综合广播":@"黄山人民广播电台的前身是屯溪人民广播电台，全天播音为17个小时。",
              @"黄山交通旅游广播":@"以清新风格、阳光品质和蓬勃朝气，黄山交通旅游广播正在成为黄山人身边的、有用的、时尚的现代服务型和休闲型广播。",
              @"北京音乐广播":@"北京音乐广播（调频97.4兆赫、有线调频94.6兆赫）是北京人民广播电台所属九个专业广播之一，是北京上空唯一一家综合音乐电台。",
              @"北京文艺广播":@"娱乐调频87.6北京文艺广播创建于1994年4月1日，是北京人民广播电台八个专业系列台之一。 北京文艺广播作为北京最具广泛影响力与传播力的强势媒体之一，在广播总体人群中,市场占有率位居北京广播市场第二位；居家人群中，市场占有率排名首位。广泛的听众群和较高的听众忠实度，使文艺广播的综合实力位居北京广播市场前列。",
              @"北京外语广播":@"目前，北京外语广播（Radio Beijing International）拥有频率 FM92.3和AM774，全天播音18小时(每周四15：00—16：00停机检修)。另有网络电台同步播出。同时，外语广播的中文节目还在美国、加拿大、澳大利亚、新西兰、新加坡、韩国等16个国家的华语电台播出。",
              @"北京故事广播":@"随着生活质量的大幅度提高，丰富多彩的精神文化产品，更加成为了社会大众生活中必不可少的一部分，“北京故事广播”的开办，将满足广大听众这方面的需求。无论古今、无论中外，人们对故事的喜爱和需要从来没有停止过。“北京故事广播”的开办宗旨就是为了让更多的听众听到好的故事。服务大众文化休闲生活、分享优秀精神产品、寓教于乐、贴近生活，将是我们的特色；弘扬先进文化，传播科学知识，促进人际和谐，提升生活品味，多方位满足公众高品质文化休闲需求，将是我们的目标。",
              @"北京体育广播":@"体育广播对外呼号：北京人民广播电台体育广播。使用频率FM102.5、AM927、CABLE FM92.7。每日播音19小时（每日05：55开始播音，次日1：00播音结束；每周四15：00－16：00、周二0:00－1:00停播检修）。",
              @"北京新闻广播":@"北京新闻广播以“新闻谈话台”为频道定位，每天19个小时的节目时间中，既有整点滚动播出的强档新闻，又有深度报道，新闻性节目占据近80%以上时段。 “及时迅速地告诉公众，在他们所生活的世界里发生了什么，以便在诸多抉择时做出参考”是北京新闻广播的使命与责任。“第一时间报道新闻”，是北京新闻广播的追求。",
              @"北京教学广播":@"这里是北京教学广播,主要定位是外语教学节目和电大电中的部分课程，全天播音18小时。",
              @"北京怀旧金曲":@"怀旧金曲广播钻石的音质，专业的频道，个性的节目，而且没有广告的干扰，目前为止，这些\"有线广播\"所达到的，开路广播不可比拟的高品质的专业广播服务是完全免费的。同时，有线广播介入方式多样，操作便利，成本低廉，只要购买一个有线调频放大器，就可以进行收听，对于广大老百姓来说是很实惠的。",
              @"北京戏曲曲艺":@"有线戏曲、曲艺调频，是北京人民广播电台文艺广播的重要组成部分，具有鲜明的专业特色。它坚持“文艺为人民服务，为社会主义服务”的方向，贯彻“百花齐放、百家争鸣”的方针，大力弘扬和发展民族文化艺术。突出艺术欣赏性、知识性和娱乐性，以优秀的戏曲、曲艺作品，满足听众日益增长的文化需求。",
              @"北京欢乐时光":@"欢乐时光广播钻石的音质，专业的频道，个性的节目，而且没有广告的干扰，目前为止，这些“有线广播”所达到的，开路广播不可比拟的高品质的专业广播服务是完全免费的。同时，有线广播介入方式多样，操作便利，成本低廉，只要购买一个有线调频放大器，就可以进行收听，对于广大老百姓来说是很实惠的。",
              @"北京长书广播":@"这里是北京电台长书广播。",
              @"北京古典音乐":@"这里是北京电台古典音乐广播。",
              @"CNR经济之声":@"中央人民广播电台经济之声是中国最有影响力的财经广播，也是唯一一套覆盖全国的财经专业媒体，覆盖全国3亿多以城市为主体的广播听众。经济之声立足于“国家级现代传媒机构”的定位，传播全球最新财经资讯，引领经济话语，是中国最具成长性的专业财经媒体。",
              @"CNR音乐之声":@"\"有一种快乐，在空中听见，Music Radio旋律在蔓延......感动让你听见——我要我的音乐\"，音乐之声是全华语市场最专业流行音乐频率，中国知名类型化流行音乐频率，覆盖全国，打破以往音乐广播板块型播出形态.",
              @"CNR中华之声":@"中央人民广播电台对台湾广播有两套专门为台湾及海外听众服务的节目，累计播音37小时50分钟，两套节目覆盖祖国大陆东南沿海、台湾地区以及东南亚、南太平洋和日本等国家",
              @"CNR华夏之声":@"中央人民广播电台第七套节目，打理您工作生活的方方面面，衣食住行，事无巨细。呈现南北文化，引领生活潮流；资讯、娱乐、休闲、时尚，引导消费，服务大众。 ",
              @"CNR神州之声":@"中央人民广播电台对台湾广播有两套专门为台湾及海外听众服务的节目，累计播音37小时50分钟，两套节目覆盖祖国大路东南沿海、台湾地区以及东南亚、南太平洋和日本等国家",
              @"CNR民族之声":@"每天用蒙古、藏、维吾尔、哈萨克和朝鲜5种民族语言播出，是一套以新闻为主的对象性节目，该套节目已经成为边疆民族地区干部群众获取国内外重大新闻的首选媒体。",
              @"CNR文艺之声":@"生活里的文艺，文艺里的生活。中央人民广播电台文艺之声，中国主流文化传播第一权威广播媒体。",
              @"CNR娱乐广播":@"这里是中央人民广播电台娱乐广播。",
              @"CNR藏语频率":@"中央电台藏语广播创办于新中国成立初期。1950年5月22日，中央电台藏语广播开始播音。藏语广播把党中央和毛主席的声音传到了尚未解放的西藏高原，为西藏的和平解放起到了号角的作用。",
              @"CNR老年之声":@"老年之声新版节目以生活资讯节目、健康养生节目和文艺节目为主，全天播出21.5小时，将最大限度满足中老年听众的多方面、个性化的需求。",
              @"广东电台优悦广播":@"中国首家跨境广播 立足深圳 服务粤港，精准服务移动群体 精英专属 品质随行，香港凤凰卫视、广东人民广播电台全力支持。",
              @"广东城市之声":@"广东广播电视台城市之声的节目以丰富多样性和都市色彩为特征，每天24小时不停放送，力求多角度、多层面地为广大听众提供高品位的节目欣赏。",
              @"重庆音乐广播":@"重庆唯一专业音乐电台，24小时不间断播出。频率定位：经典流行音乐，满足听众的品质追求，为城市精英人群提供最贴心的陪伴和服务",
              @"哈尔滨交通广播":@"这里是哈尔滨交通台，热线电话：82119002   87997337 ",
              @"哈尔滨经济广播":@"哈尔滨经济广播电台成立于1992年，在哈尔滨地区使用AM972千周发射信号，有效覆盖人口达1000万以上。以关注百姓民生，服务百姓生活为出发点，突出财经专业服务特色，是黑龙江省唯一的专业经济广播电台。",
              @"哈尔滨音乐广播":@"这里是哈尔滨音乐广播",
