              @"西双版纳综合广播FM90.6":@"国家广电总局于2011年7月22日下文批准西双版纳傣族自治州人民广播电台和西双版纳傣族自治州电视台合并设立西双版纳傣族自治州广播电视台，开办广播、电视业务。统一呼号“西双版纳广播电视台”。",
              @"甘肃经济广播934驾车调频":@"甘肃经济广播934驾车调频是甘肃省委，省政府为实施党中央，国务院西部大开发的战略而批准开办的。2016年，甘肃经济广播—934驾车调频以“小经济、大服务”、“车轮上的经济广播”为全新定位，立志打造“信息性、服务性、参与性”的移动互联的全新广播平台。始终以个性鲜明，特色突出的全新节目为广大听众提供更加真诚的服务。未来，我们将为客户的品牌建设、形象推广提供更多战略性、个性化的广告策划和投放方案。",
              @"江苏交通广播":@"江苏交通广播网，全国省级交通广播前三强。交广网倾力公益慈善事业，服务交通弱势群体。交广网率先全国成立第一个拥有法人资质的社团组织——交广网爱心车队。交广网率先成立了主持人艺术团体——“交广网明星主持人艺术团”，成为江苏文化演出名片。交广网打造中国第一个服务于移动人群的专业资讯平台——“96911”交通信息中心，提供整合交通资讯。",
              @"长沙FM101.7城市之声":@"优音乐·优生活·音乐优电台",
              @"浙江经济广播":@"FM95浙江经济广播是浙江省内唯一的省级专业财经广播。频道自1989年12月25日首播，迄今已开播25周年。频道秉持“懂财经 爱生活”的宗旨，用通俗的方式解读财经，用财经的视角解读生活。",
              @"浙江之声":@"浙江之声，浙江广播主频率，浙江省委省政府唯一指定信息权威发布的广播平台，被评为全国最具实力的省级新闻广播。浙江之声以公务员、事业、商务人士、都市白领为核心听众群，是全省900多万辆车主收听新闻的主要渠道之一，是全省覆盖最广的电台，有效覆盖8000多万人口。自2008年以来，连续八年，全省收听率第一、到达率第一、忠诚度第一。在蜻蜓FM客户端，浙江之声各项收听指标收听始终名列浙江第一。",
              @"浙江民生996":@"FM99.6 创办于1992年，是浙江最早的调频电台之一。2014年夏季，“Wi-Fi Radio”横空出世，以崭新的网络思维设计传统广播，强调线下互动，以特殊的点面交互方式，来构架节目内容，让您在行车路上与互联网世界实时同步，永不掉线。FM 99.6 WIFI Radi",
              @"FM93浙江交通之声":@"浙江电台交通之声于1998年5月18日正式播音,依托调频同步广播技术优势,先进的办台理念和创新奉献的精神，稳定持续发展。自2000年以来，一直引领浙江广播，连续9年创造了全省收听率第一、覆盖面第一、广告创收第一、影响力第一的骄人成绩，并创造了中国广播的多项第一。",
              @"浙江城市之声":@"私家车第一广播·城市之声，快乐梦想家！拥有全球最顶尖的主持群，创造知名品牌：《阿亮的烦恼生活》、《娱乐大爆炸》、《私家车上班路上》、《107国学馆》。中国私家车广播领跑者，为你定制最快乐车上节目。梦想由此开始……",
              @"FM1045浙江女主播电台":@"FM1045女主播电台温淑贤慧——听生活低音 品时尚高调。目标受众：25—40岁之间中高端有车一族。频率定位：为中高端有车一族打造全国唯一的女主播电台。用细腻、柔美的声音体现品质、时尚的风格；用实用、前沿的讯息，有效地结合本地内容，为杭州主流中高端人群提供汽车时代全方位的个性服务。传递快乐，抚慰心灵。风格定位：活力时尚、轻松快乐、柔美亲切。内容定位：节目聚焦中高端有车一族这个受众类型关心的内容，突出个性、时尚、品质。纵向--资讯娱乐滚动，横向--专业服务放大。以亲切、娱乐为皮，内核是与类型人群日常品质生活紧密联系的各种实用信息。资讯、本土、互动、娱乐融为一体 全部女性主持、丰富实用的",
              @"温岭1036电台":@"温岭FM103.6，打造温岭第一强势媒体！全天24小时播音，为听众提供最实用、最新鲜的本地资讯。",
              @"开封经济广播":@"开封旅游广播U-radio简介 心系古城文化梦想，倡导悠然品质生活 开封旅游广播调频（FM）100.2，覆盖半径70公里，以传承弘扬开封传统文化为切入点，全方位展示推介开封文化旅游资源；贴近市民文化旅游消费需求，为“吃住行游购娱”等产品和服务搭建最直接、最有效的宣传推广平台。目前， 开封旅游广播自办十余档广播节目，节目内容丰富，形态多样，地域特色、文化气息浓郁。其中《疯狂开封话》、《U-R",
              @"青苹果音乐台":@"青苹果音乐台  「乐动青春」我有我的Young！全天24小时线上陪伴，网络上空最懂你的音乐电台。",
              @"蚌埠交通文艺广播":@"蚌埠交通文艺广播是蚌埠蚌埠广播电视台广播第三套频率，也是蚌埠上空第一家当地交通专业频率",
              @"AsiaFM亚洲音乐台":@"AsiaFM亚洲音乐台 悦听越青春 亚洲顶尖线上流行音乐第一台电台官方网站：www.asiafm.cn",
              @" China Plus Radio":@"中国国际广播电台英语环球，中国最权威的英语资讯广播电台。学英语，听中国，知世界！Follow China Plus, follow China's changing pace!新浪微博：@英语环球广播 微信公众号：NEWSPlus",
              @"福建汽车音乐调频":@"FM91.3汽车音乐调频作为福建省最专业的汽车音乐调频，全天24小时播出。精准引导您聆听经典音乐，用经典音乐营造私家车主的优质生活空间。",
              @"淮安经济生活":@"淮安电视台以独特的区位优势，强劲的媒体优势，全面的营销策略，稳步的改革发展，打造周总理故乡的电视品牌。目前拥有新闻综合频道、都市生活频道、影视频道三个频道。推出了《淮安新闻联播》《家在淮安》《法制播报》《今日观察》《海外娱乐现场》等精彩栏目，栏目齐全品牌众多，为加快苏北地区的发展做出了贡献。",
              @"淮安交通文艺":@"“淮安交通文艺广播”开播12年以来，一直以“帮助他人，温暖自己”为行动宣言，时刻体现“欢乐调频，爱心广播”的办台宗旨。 2017年，频率以司机、出行人和交通从业者为直接收听群体进行了全新改版：《1+1早高峰》、《交广路路通》、《车友俱乐部》、《常亮茶馆》《乐动十点》等节目深受好评！2017，我们有你更精彩！",
              @"淮安FM104.2":@"●频率定位：为中高端移动人群“量耳定造”舒适愉悦的汽车生活体验，将“汽车”与“音乐”元素相结合，让经典音乐伴随车轮滚动。●听众定位：以中青年城市私家车主为核心的主流听众群。●风格定位：启用气质DJ群，告别陈旧的演绎手法，轻松幽默、活力时尚。●内容定位：加强本地资讯，提供贴心服务，突出公益诉求。●节目的编排定位：遵循车主工作日、双休日生活节奏的规律变化和需求而定。音乐节目种类齐全，强调伴随性",
              @"淮安新闻综合":@"这里是淮安新闻综合频率。",
              @"潮州交通音乐广播":@"潮州人民广播电台成立于1990年1月18日，十多年来，潮州人民广播电台立足改革，锐意开拓，突破传统的播出模式，逐步实现了“一年一小步，三年一大步，五年一台阶，十年一跨越”的发展目标，录、编、播、贮设备全面实现数字化，达到国内地市级电台先进水平；信号清晰覆盖粤东和闽南地区；两套自办节目特色鲜明，风格突出，深受群众欢迎。",
              @"潮州综合频率":@"FM93.9兆赫的潮州人民广播电台，创办于1990年1月18日，集新闻、文艺、娱乐、服务于一体，每天18小时播音。",
              @"梧州交通音乐之声":@"FM1075梧州电台交通音乐之声是一个具有鲜明形象和全新机制的专业频道，其宗旨是“传播交通信息、引领音乐时尚”，主要面向驾车族、乘车族、爱车族和广大热爱音乐的朋友。",
              @"邯郸音乐广播":@"",
              @"潮州戏曲广播":@"FM103.1兆赫的潮州人民广播电台戏曲之声正式开播于2004年10月1日，是继浙江绍兴电台开播后的全国第二家、广东省第一家戏曲频率，以潮州戏曲作为主线，每天16小时播音。",
              @"镇江文艺频率":@"FM96.3镇江文艺广播是一个突出欣赏性、娱乐性、具有知识性、权威性并兼容各种音乐娱乐资讯及文化信息、高品味、全方位的文艺电台。全天播音20.5个小时（早晨5:30-凌晨2:00）。",
              @"江西绿色985":@"江西人民广播电台FM98.5绿色之声，是江西唯一省级“面向农村、服务三农、统筹城乡、服务大众”的专业媒体，秉承“绿色、科技、人文”的理念，以赣鄱大地三千多万新农村和城乡建设者为目标听众，以江西丰富的绿色资源和快速崛起的生态经济为发展基石，关注民生、突出服务、着力打造“宣传服务三农最佳载体、对接城乡市场优质平台”。",
              @"怀集网络电台":@"怀集网络电台目前是肇庆地区网络电台排行第二的网络电台。"
              

